import React from 'react';
import { Link } from 'react-router-dom';
import {Menu, Icon} from 'antd'

import './App.css';



function Nav() {

  return (
    <nav >
      <Menu style={{textAlign: 'center'}} mode="horizontal" theme="dark">

        <Menu.Item key="mail">
          <Icon type="home" />
          <Link to='/sources'>Sources</Link>
        </Menu.Item>

        <Menu.Item key="test">
          <Icon type="read" />
          <Link to='/myarticles'>My Articles</Link>
        </Menu.Item>

        <Menu.Item key="app">
          <Icon type="logout" />
          Logout
        </Menu.Item>

      </Menu>
    </nav>
  );
}

export default Nav;
